import { Link } from "react-router-dom";

export default function ReferenceMenu() {
	return (
		<div className="reference-menu">
			<nav>
			<Link to="/references/sections/doors">Dør og Vindu</Link>
            <Link to="/references/sections/bathroom">Bad</Link>
            <Link to="/references/sections/rehab">Rehabilitering</Link>
            <Link to="/references/sections/outdoors">Uteområde</Link>
            <Link to="/references/sections/garage">Garasje</Link>
		</nav>
		</div>
	);
}
